import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Route path="/" exact component={App1}></Route>
      <Route path="/page2" component={App2}></Route>
    </BrowserRouter>
  );
};

const App1 = () => {
  return (
    <div>
      <div>Motoro 1</div>
      <br />
      <Link to="/page2"></Link>
    </div>
  );
};

const App2 = () => {
  return (
    <div>
      <div>Motoro 2</div>
      <br />
      <Link to="/"></Link>
    </div>
  );
};

export default App;
